import React, { useState, useEffect } from "react";
import { Helmet } from "react-helmet";
import axios from "axios";

import NavBar from "../components/common/navBar";
import Footer from "../components/common/footer";
import Logo from "../components/common/logo";
import INFO from "../data/user";
import SEO from "../data/seo";

import "./styles/submitForm.css";

const SubmitForm = () => {
	const [formData, setFormData] = useState({
		name: "",
		email: "",
		message: "",
	});

	const [messageSent, setMessageSent] = useState(false);

	useEffect(() => {
		window.scrollTo(0, 0);
	}, []);

	const currentSEO = SEO.find((item) => item.page === "submit");

	const handleChange = (e) => {
		setFormData({ ...formData, [e.target.name]: e.target.value });
	};

	const handleSubmit = async (e) => {
		e.preventDefault();

		try {
			await axios.post("http://localhost:5000/api/customers", formData);
			setMessageSent(true);
			setFormData({ name: "", email: "", message: "" });
		} catch (error) {
			console.error("Gagal mengirim pesan:", error);
			alert("Gagal mengirim pesan.");
		}
	};

	return (
		<React.Fragment>
			<Helmet>
				<title>{`Submit | ${INFO.main.title}`}</title>
				<meta
					name="description"
					content={currentSEO?.description || ""}
				/>
				<meta
					name="keywords"
					content={currentSEO?.keywords?.join(", ") || ""}
				/>
			</Helmet>

			<div className="page-content">
				<NavBar active="submit" />
				<div className="content-wrapper submit-container">
					<div className="submit-first-area">
						<div className="submit-logo-container">
							<Logo width={46} />
						</div>

						<div className="submit-first-area-left-side">
							<div className="submit-title">
								Diskusikan Proyek Anda
							</div>
							<div className="submit-subtitle">
								Silakan isi formulir di bawah ini. Saya akan
								menghubungi Anda secepat mungkin.
							</div>

							<form
								className="submit-form"
								onSubmit={handleSubmit}
							>
								<input
									type="text"
									name="name"
									placeholder="Nama Anda"
									value={formData.name}
									onChange={handleChange}
									required
								/>

								<input
									type="email"
									name="email"
									placeholder="Email Anda"
									value={formData.email}
									onChange={handleChange}
									required
								/>

								<textarea
									name="message"
									placeholder="Pesan Anda"
									value={formData.message}
									onChange={handleChange}
									required
								></textarea>

								<button type="submit">Kirim Pesan</button>

								{messageSent && (
									<p
										style={{
											color: "green",
											marginTop: "10px",
										}}
									>
										Pesan berhasil dikirim!
									</p>
								)}
							</form>
						</div>
					</div>
				</div>

				<Footer />
			</div>
		</React.Fragment>
	);
};

export default SubmitForm;
